import{_ as t,c as e,o as d,a as r}from"./app.520866a0.js";const P=JSON.parse('{"title":"快速开始","description":"","frontmatter":{},"headers":[{"level":2,"title":"简介","slug":"简介","link":"#简介","children":[]},{"level":2,"title":"推荐的访问方式","slug":"推荐的访问方式","link":"#推荐的访问方式","children":[]},{"level":2,"title":"APP","slug":"app","link":"#app","children":[{"level":3,"title":"APP客户端下载链接","slug":"app客户端下载链接","link":"#app客户端下载链接","children":[]}]},{"level":2,"title":"浏览器","slug":"浏览器","link":"#浏览器","children":[]},{"level":2,"title":"订阅","slug":"订阅","link":"#订阅","children":[]},{"level":2,"title":"IE浏览器","slug":"ie浏览器","link":"#ie浏览器","children":[]},{"level":2,"title":"特殊程序","slug":"特殊程序","link":"#特殊程序","children":[]}],"relativePath":"index.md","lastUpdated":1675306839000}'),a={name:"index.md"},o=r('<h1 id="快速开始" tabindex="-1">快速开始 <a class="header-anchor" href="#快速开始" aria-hidden="true">#</a></h1><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-hidden="true">#</a></h2><p>  工一云电脑是涛勰科技自主研发的一整套云教学、云办公的解决方案，是面向未来的下一代教学与办公产品。底座采用自主研发，上层基于主流的微软桌面，是通过多年探索研发的AnyTime、AnyWhere、AnyDevice的云上教学办公的集大成产品。</p><p>  工一云电脑企业版：办公不再依赖于传统孤立的PC电脑，而是将办公的计算、储存、网络资源全部集中于私有云或者混合云中；通过后端的云管理系统进行集中管理与资源分配；管理员进行系统软件的集中安装与分配，云电脑开箱即用；可以轻松实现员工内部的数据协同；提供员工一致性的电脑体验，即办公室、回家、出差都能访问同一个云电脑进行高效办公。</p><p>  工一云电脑支持包含各种电脑、平板、手机、智能电视、单片机、零瘦客户机等全终端设备，同时支持APP客户端、浏览器、订阅等多种方式进行访问。</p><h2 id="推荐的访问方式" tabindex="-1">推荐的访问方式 <a class="header-anchor" href="#推荐的访问方式" aria-hidden="true">#</a></h2><p>  云电脑访问方式有多种，包含APP客户端、浏览器、订阅、IE浏览器、特殊程序的方式进行访问，但最常用的方式是APP客户端和浏览器方式。<br>   访问方式选择总体建议：支持APP客户端的首先推荐APP客户端访问，其次是浏览器访问；临时性访问推荐直接浏览器访问。具体如下：</p><table><thead><tr><th>操作系统</th><th>台式/一体机/笔记本/微型电脑/虚拟机</th><th>平板</th><th>手机</th><th>智能电视</th><th>单片机</th><th>零瘦客户端</th></tr></thead><tbody><tr><td>Windows</td><td>APP, 浏览器, 订阅, IE浏览器</td><td>同左</td><td></td><td></td><td></td><td></td></tr><tr><td>Andriod</td><td></td><td>APP, 浏览器</td><td>APP</td><td>APP</td><td></td><td></td></tr><tr><td>iOS</td><td></td><td></td><td>APP</td><td></td><td></td><td></td></tr><tr><td>iPadOS</td><td></td><td>APP, 浏览器</td><td></td><td></td><td></td><td></td></tr><tr><td>macOS</td><td>APP, 浏览器</td><td></td><td></td><td></td><td></td><td></td></tr><tr><td>ChromeOS</td><td></td><td>APP, 浏览器</td><td>APP</td><td></td><td></td><td></td></tr><tr><td>HarmonyOS</td><td></td><td>APP, 浏览器</td><td>APP</td><td></td><td></td><td></td></tr><tr><td>WinPhoneOS</td><td></td><td></td><td>APP</td><td></td><td></td><td></td></tr><tr><td>RaspBerryOS</td><td></td><td></td><td></td><td></td><td>特殊程序</td><td></td></tr><tr><td>ThinOS</td><td></td><td></td><td></td><td></td><td></td><td>特殊程序</td></tr><tr><td>Linux Desktop</td><td>浏览器</td><td>浏览器</td><td></td><td></td><td></td><td></td></tr><tr><td>Linux Server</td><td>特殊程序</td><td></td><td></td><td></td><td>特殊程序</td><td>特殊程序</td></tr></tbody></table><h2 id="app" tabindex="-1">APP <a class="header-anchor" href="#app" aria-hidden="true">#</a></h2><h3 id="app客户端下载链接" tabindex="-1">APP客户端下载链接 <a class="header-anchor" href="#app客户端下载链接" aria-hidden="true">#</a></h3><ul><li><a href="https://apps.microsoft.com/store/detail/microsoft-%E8%BF%9C%E7%A8%8B%E6%A1%8C%E9%9D%A2/9WZDNCRFJ3PS" target="_blank" rel="noreferrer">Windows</a> 注：此链接为Microsoft市场，国内用户如果无法下载，请点击以下链接下载 <ul><li><a href="https://tx.cec.cc/RDWeb/Pages/downloads/Microsoft_Remote_Desktop_for_Windows.AppxBundle" target="_blank" rel="noreferrer">Windows 11</a></li><li><a href="https://tx.cec.cc/RDWeb/Pages/downloads/Microsoft_Remote_Desktop_for_Windows.zip" target="_blank" rel="noreferrer">Windows 10</a></li></ul></li><li><a href="https://play.google.com/store/apps/details?id=com.microsoft.rdc.androidx&amp;pli=1" target="_blank" rel="noreferrer">Andriod/ChromeOS</a> 注：此链接为Google市场，国内用户请点击以下链接下载 <ul><li><a href="https://tx.cec.cc/RDWeb/Pages/downloads/Microsoft_Remote_Desktop_for_Andriod_Latest.apk" target="_blank" rel="noreferrer">Andriod最新版</a></li><li><a href="https://tx.cec.cc/RDWeb/Pages/downloads/Microsoft_Remote_Desktop_for_Andriod9.0.apk" target="_blank" rel="noreferrer">Andriod 9.0+</a></li><li><a href="https://tx.cec.cc/RDWeb/Pages/downloads/Microsoft_Remote_Desktop_for_Andriod8.0.apk" target="_blank" rel="noreferrer">Andriod 8.0+</a></li><li><a href="https://tx.cec.cc/RDWeb/Pages/downloads/Microsoft_Remote_Desktop_for_Andriod7.0.apk" target="_blank" rel="noreferrer">Andriod 7.0+</a></li><li><a href="https://tx.cec.cc/RDWeb/Pages/downloads/Microsoft_Remote_Desktop_for_Andriod6.0.apk" target="_blank" rel="noreferrer">Andriod 6.0+</a></li><li><a href="https://tx.cec.cc/RDWeb/Pages/downloads/Microsoft_Remote_Desktop_for_Andriod_Old.apk" target="_blank" rel="noreferrer">Andriod 6.0+旧版兼容版</a></li><li><a href="https://tx.cec.cc/RDWeb/Pages/downloads/Microsoft_Remote_Desktop_for_Andriod4.0.apk" target="_blank" rel="noreferrer">Andriod 4.0+</a></li></ul></li><li><a href="https://tx.cec.cc/RDWeb/Pages/downloads/Microsoft_Remote_Desktop_for_HarmonyOS.apk" target="_blank" rel="noreferrer">HarmonyOS</a>注：如果此应用不兼容，可以下载上面Andriod的老版本依次测试</li><li><a href="https://apps.apple.com/cn/app/microsoft-yuan-cheng-zhuo/id714464092" target="_blank" rel="noreferrer">iOS/iPadOS</a></li><li><a href="https://apps.apple.com/us/app/microsoft-remote-desktop/id1295203466" target="_blank" rel="noreferrer">macOS</a></li></ul><p>  适合支持安装APP客户端的系统。<br>   不同终端系统的APP客户端不同，但操作大同小异，本示例以Andriod手机为例。首先根据系统点击以下对应的链接进行下载安装；</p><ol><li>下载安装好APP客户端后，打开应用，点击右上角的加号，选择“添加工作区”，外网输入&quot;<a href="http://tx2.cec.cc:8000" target="_blank" rel="noreferrer">tx2.cec.cc:8000</a>&quot;，内网输入&quot;<a href="http://tx.cec.cc" target="_blank" rel="noreferrer">tx.cec.cc</a>&quot;，用户账户点击下拉选择“添加用户账户”，输入个人账号demo@cec.cc和个人密码并点击保存；</li><li>然后点击右上角的“下一步”，等待加载一两秒钟，点击“工作区”，此时会显示所有的应用程序和桌面资源；</li><li>点击桌面或应用会弹出一个连接选项框，点击“连接”；</li><li>进入桌面或应用后，顶部会出现一个鼠标键盘选项，移动端的鼠标操作分触屏模式和鼠标模式，根据习惯选择对应的模式即可。</li></ol><h2 id="浏览器" tabindex="-1">浏览器 <a class="header-anchor" href="#浏览器" aria-hidden="true">#</a></h2><p>  适用于所有安装有H5浏览器的桌面系统。<br>   目前主流的浏览器都支持Html5：360、Edge、Opera、Chrome、Safari、Firefox浏览器等。</p><ol><li>H5浏览器只需输入<a href="https://tx.cec.cc" target="_blank" rel="noreferrer">https://tx.cec.cc</a> ，输入用户名和密码进行登录；</li><li>登陆到资源页面可就以访问远程应用和桌面了，部分应用不能支持，可以采用登陆桌面方式进行访问；如果要输入中文，需要点击右上角“设置”按钮，注意切换语言略有不同（单键Shift）；</li><li>点击进入远程应用或桌面，图为H5浏览器的嵌入式访问效果。</li></ol><h2 id="订阅" tabindex="-1">订阅 <a class="header-anchor" href="#订阅" aria-hidden="true">#</a></h2><p>  仅适用于windows桌面系统。</p><ol><li>控制面板打开RemoteApp与桌面连接。</li><li>按照向导输入URL地址，外网输入&quot;<a href="http://tx2.cec.cc:8000" target="_blank" rel="noreferrer">tx2.cec.cc:8000</a>&quot;，内网输入&quot;<a href="http://tx.cec.cc" target="_blank" rel="noreferrer">tx.cec.cc</a>&quot;，；</li><li>最后就可在开始程序菜单直接访问远程应用和桌面。</li></ol><h2 id="ie浏览器" tabindex="-1">IE浏览器 <a class="header-anchor" href="#ie浏览器" aria-hidden="true">#</a></h2><p>  适用于具有IE浏览器的windows系统。<br>   Windows终端可以通过IE浏览器访问，实际是系统自带了“远程桌面连接”APP客户端工具，通过浏览器调用工具打开远程应用或桌面。<br>   注意：WinXP和Win7在非局域网环境下并不支持IE浏览器方式访问，请参照H5浏览器。</p><ol><li>打开IE浏览器，地址栏输入<a href="https://tx.cec.cc" target="_blank" rel="noreferrer">https://tx.cec.cc</a> ，输入用户名和密码进行登录；</li><li>首次登录会提示保存密码，点击“是”，方便下次登陆；</li><li>首次登录还会提示是否运行加载项，点击“允许”，可以实现更佳访问云应用和云桌面体验；</li><li>非同域中电脑首次打开会提示信任发布者提示，勾选“不再询问我是否从此发布者进行远程连接”，可获得更佳的单点访问体验。</li></ol><h2 id="特殊程序" tabindex="-1">特殊程序 <a class="header-anchor" href="#特殊程序" aria-hidden="true">#</a></h2><p>  一般适用于非桌面系统或者定制thinos。普通用户一般无需关注。</p>',24),i=[o];function l(c,n,h,s,p,_){return d(),e("div",null,i)}const A=t(a,[["render",l]]);export{P as __pageData,A as default};
